import React from "react";

const Service = () => {
  return (
    <div className="services">
      <div className="container">
        <div className="service-header">
          <h2>My services for your business</h2>
          <p>
            Over the past 2 years, I have learned and mastered these skills. I
            put all these skills into work and produce a master piece for your
            business,
          </p>
        </div>

        <div className="dollar-img">
          <img src="" alt="" />
          <img src="" alt="" />
          <img src="" alt="" />
        </div>
      </div>
    </div>
  );
};

export default Service;
